import React from "react";
import "./footer.css";
import { Col, Row, Container, ListGroup, ListGroupItem } from "reactstrap";
import { Link } from "react-router-dom";
import logo from "../../assets/images/logo.png";

const quick__links = [
  {
    path: "/home",
    display: "Home",
  },
  {
    path: "/about",
    display: "About",
  },
  {
    path: "/tours",
    display: "Tours",
  },
];

const quick__links2 = [
  {
    path: "/gallery",
    display: "Gallery",
  },
  {
    path: "/login",
    display: "Login",
  },
  {
    path: "/register",
    display: "Register",
  },
];

const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row>
          <Col lg="3">
            <div className="logo">
              <img src={logo} alt="" />
              <p>
                Anim ut magna consequat proident exercitation mollit mollit
                ipsum veniam non Lorem eu incididunt.
              </p>

              <div className="social__links d-flex align-items-center gap-4">
                <span>
                  <Link to="">
                    <i class="ri-youtube-fill"></i>
                  </Link>
                </span>
                <span>
                  <Link to="">
                    <i class="ri-github-fill"></i>
                  </Link>
                </span>
                <span>
                  <Link to="">
                    <i class="ri-instagram-fill"></i>
                  </Link>
                </span>
                <span>
                  <Link to="">
                    <i class="ri-linkedin-fill"></i>
                  </Link>
                </span>
              </div>
            </div>
          </Col>
          <Col lg="3">
            <h5 className="footer__link_title">Discover</h5>
            <ListGroup className="footer_quick_links">
              {quick__links.map((item, index) => (
                <ListGroupItem key={index} className="ps-0 border-0">
                  <Link to={item.path}>{item.display}</Link>
                </ListGroupItem>
              ))}
            </ListGroup>
          </Col>
          <Col lg="3">
            <h5 className="footer__link_title">Quick Links</h5>
            <ListGroup className="footer_quick_links">
              {quick__links2.map((item, index) => (
                <ListGroupItem key={index} className="ps-0 border-0">
                  <Link to={item.path}>{item.display}</Link>
                </ListGroupItem>
              ))}
            </ListGroup>
          </Col>

          <Col lg=''>
          <h5 className="footer__link_title">Contact</h5>
                <ListGroupItem className="ps-0 border-0 d-flex ">
                </ListGroupItem>
          </Col>
        </Row>
      </Container>
    </footer>
  );
};

export default Footer;
